INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAME', 'STOCK', 'Atlantic American Corporation', 'NGM', 'Financial Services', 'Insurance - Life', 'Atlantic American Corporation is an insurance holding company involved, through its subsidiary companies, in specialty markets of the life, health, and property and casualty insurance industries. The Companys principal insurance subsidiaries are American Southern Insurance Company and American Safety Insurance Company (American Southern) within the property and casualty insurance industry and Bankers Fidelity Life Insurance Company, Bankers Fidelity Assurance Company and Atlantic Capital Life Assurance Company (Bankers Fidelity) within the life and health insurance industry. American Southern''s primary product lines include commercial automobile insurance, general liability insurance, and surety bonds. Bankers Fidelity comprises the life and health operations of the Company and offers a variety of life and supplemental health products. Products offered by Bankers Fidelity include ordinary life insurance, Medicare supplements and other accident and health insurance products.', 'Atlanta, GA, United States', 153);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVU', 'STOCK', 'CPI Aerostructures, Inc.', 'ASE', 'Industrials', 'Aerospace & Defense', 'CPI Aerostructures, Inc. (CPI Aero), incorporated on January 11, 1980 , is a manufacturer of structural assemblies, integrated systems, and kitted components for the domestic and international aerospace and defense (A&D) markets. CPI Aero is a supplier of aircraft parts for fixed wing aircraft and helicopters in both the commercial and defense markets in the United States. CPI Aero provides manufacturing engineering, program management, supply chain management, kitting and maintenance repair and overhaul (MRO) services. The Company supplies its products to original equipment manufacturers (OEMs) as well as, the Company is a prime contractor to the United States Department of Defense (DOD), primarily for the United States Air Force (USAF). The Companys products are used by customers in the production of fixed wing aircraft, helicopters, electronic warfare (EW) systems, intelligence, surveillance, and reconnaissance (ISR) systems, missiles, and other sophisticated A&D products.', 'Edgewood, NY, United States', 212);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANSC', 'STOCK', 'Agriculture & Natural Solutions Acquisition Corporation', 'NGM', 'Financial Services', 'Shell Companies', 'Agriculture & Natural Solutions Acquisition Corporation is a blank check company. The Company is formed for the purpose of effecting a merger, amalgamation, share exchange, asset acquisition, share purchase, reorganization or similar business combination with one or more businesses. It intends to identify and execute an initial business combination within the agriculture sector in the United States or other developed countries, although it may pursue targets in any business, industry, sector, or geographical location. It has neither engaged in any operations nor generated any revenues.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSVN', 'STOCK', 'Bank7 Corp.', 'NMS', 'Financial Services', 'Banks - Regional', 'Bank7 Corp. is a bank holding company. The Company, through its wholly-owned subsidiary, Bank7, operates approximately twelve locations in Oklahoma, the Dallas/Fort Worth, Texas metropolitan area and Kansas. The Company is focused on serving business owners and entrepreneurs by delivering loan and deposit products to meet their financing needs. It has a particular focus on various loan categories, including commercial real estate lending (CRE), hospitality lending, energy lending, and commercial and industrial lending. It also provides consumer lending services to individuals for personal and household purposes, including secured and unsecured term loans and home improvement loans. The Company offers deposit banking products, including commercial deposit services, commercial checking, money market, and other deposit accounts, and retail deposit services such as certificates of deposit, money market accounts, checking accounts, savings accounts, and automated teller machine access.', 'Oklahoma City, OK, United States', 124);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FITBP', 'STOCK', 'Fifth Third Bancorp', 'NMS', 'Financial Services', 'Banks - Regional', 'Quinto Terceiro Bancorp é uma sociedade diversificada de serviços financeiros e é a holding indireta do quinto terceiro banco, Associação Nacional (o Banco). Seu segmento de Banca Comercial oferece intermediação de crédito, gestão de caixa e serviços financeiros para grandes e médios negócios e clientes governamentais e profissionais. Seu segmento de Bancos para Consumidores e Pequenas Empresas oferece uma gama completa de produtos de depósito e empréstimo para indivíduos e pequenas empresas através de uma rede de centros bancários de serviço completo e relacionamentos com originadores de empréstimos indiretos e correspondentes, além de fornecer produtos projetados para atender às necessidades específicas de pequenas empresas, incluindo serviços de gestão de caixa. O seu segmento de Gestão de Riqueza e Ativos oferece uma gama completa de soluções de gestão de riqueza para indivíduos, empresas e organizações sem fins lucrativos, incluindo planejamento de riqueza, gestão de investimentos', 'Cincinnati, OH, United States', 18690);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIFD', 'STOCK', 'TCW Artificial Intelligence ETF', 'NGM', NULL, NULL, 'The fund will invest, under normal circumstances, at least 80% of the value of its net assets, plus the amount of any borrowings for investment purposes, in securities of businesses that the Adviser has identified, through annual reports, press releases and other public statements by an issuer, as well as the Adviser’s due diligence process, as using, or as having demonstrated an intent to use, predictive or generative AI in a way that is or has the potential to deliver a material improvement in the company’s financial condition. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FCA', 'STOCK', 'First Trust China AlphaDEX Fund', 'NGM', NULL, NULL, 'The fund will normally invest at least 90% of its net assets (including investment borrowings) in the securities that comprise the index. The index is designed to select stocks from the NASDAQ China Index (the "base index") that may generate positive alpha, or risk-adjusted returns, relative to traditional indices through the use of the AlphaDEX® selection methodology.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EPOW', 'STOCK', 'Sunrise New Energy Co., Ltd.', 'NCM', 'Industrials', 'Electrical Equipment & Parts', 'Sunrise New Energy Co Ltd, formerly Global Internet of People Inc, is a holding company engaged in providing enterprise services to small and medium-sized enterprises. The Company mainly offers four kinds of services, member services, enterprise services, online services and other services. The enterprise services include three types. The comprehensive tailored services include tailored packaged services, such as conference and salon organization, booth exhibition services, on-site Mentors'' guidance, and other value-added services. The sponsorship advertising services include sponsorship advertising on certain activities. The consulting services include corporate reorganization, product promotion and marketing, industry supply chain integration, corporate governance, financing and capital structure. The online services include questions and answers (Q&A) session with chosen Mentors and online streaming of courses and programs via its mobile application (APP) Shidonghui App.', 'Zibo, , China', 48);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APT', 'STOCK', 'Alpha Pro Tech, Ltd.', 'ASE', 'Industrials', 'Building Products & Equipment', 'Alpha Pro Tech, Ltd. is engaged in developing, manufacturing and marketing a line of disposable protective apparel and infection-control products for the cleanroom, industrial, pharmaceutical, medical and dental markets through its wholly owned subsidiary, Alpha Pro Tech, Inc. It also manufactures a line of building supply construction weatherization products through its wholly owned subsidiary, Alpha ProTech Engineered Products, Inc. Its products are sold under the Alpha Pro Tech brand and private labels. Its products are grouped into two business segments: the Building Supply segment, consisting of construction weatherization products, such as housewrap, housewrap accessories, synthetic roof underlayment and synthetic roof underlayment accessories, as well as other woven materials; and the Disposable Protective Apparel segment, consisting of disposable protective garments (including shoecovers, bouffant caps, coveralls, gowns, frocks and lab coats), face masks and face shields.', 'Aurora, ON, Canada', 130);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COPJ', 'STOCK', 'Sprott Junior Copper Miners ETF', 'NGM', NULL, NULL, 'The fund will, under normal circumstances, invest at least 80% of its total assets in securities of the index. The index is designed to track the performance of companies that derive at least 50% of their revenue and/or assets from mining, exploration, development, and production of copper. The index generally consists of from 25 to 45 constituents. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EFOI', 'STOCK', 'Energy Focus, Inc.', 'NCM', 'Consumer Cyclical', 'Furnishings, Fixtures & Appliances', 'Energy Focus, Inc. is a provider of sustainable light-emitting diode (LED) lighting and lighting control technologies and solutions. The Company develops, markets and sells LED lighting and controls products in the commercial market and military maritime market (MMM). It develops LED lighting products and controls that provide extensive energy and maintenance savings, as well as aesthetics, safety, health and sustainability benefits over conventional lighting. It specializes in LED lighting retrofit by replacing fluorescent, high-intensity discharge lighting and other types of lamps in institutional buildings for primarily indoor lighting applications with its commercial and military-grade tubular LED (TLED) products, as well as other LED and lighting control products for commercial applications. The Company is also evaluating adjacent technologies including Gallium Nitride (GaN)-based power supplies and additional market opportunities for energy solution products.', 'Solon, OH, United States', 9);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWBBP', 'STOCK', 'Bridgewater Bancshares, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Bridgewater Bancshares, Inc. is a financial holding company with one wholly owned subsidiary, Bridgewater Bank (the Bank). The Bank focuses primarily on commercial lending, consisting of loans secured by nonfarm, nonresidential properties, loans secured by multifamily residential properties, nonowner occupied single family residential properties, construction loans, land development loans and commercial and industrial loans. The Bank offers loan and deposit products primarily for commercial clients. The Bank also offers consumers traditional retail deposit products through its branch network, along with online, mobile, and direct banking channels. The Bank has developed a suite of deposit products targeted at commercial clients, including a variety of remote deposit and cash management products, along with commercial transaction accounts. The Bank has nine full-service offices located in Bloomington, Greenwood, Minneapolis (two), St. Louis Park, Orono, and St. Paul, Minnesota.', 'Saint Louis Park, MN, United States', 308);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABLLL', 'STOCK', 'Abacus Life, Inc. 9.875% Fixed Rate Senior Notes due 2028', 'NGM', NULL, NULL, 'Abacus Global Management, Inc. is a financial services company specializing in alternative asset management, data-driven wealth solutions, technology innovations, and institutional services. The Companys segments include Asset Management, Life Solutions and Technology Services. The Asset Management segment provides asset management services to primarily institutional investors alongside private clients investing in uncorrelated and longevity-based assets, fixed-income replacement strategies and free cash flow based investment solutions. It also provides policy servicing activities to customers on a contract basis. The Life Solutions segment is engaged in buying, selling, and trading policies, and maintaining policies until receipt of death benefits. The Technology Services segment provides real-time mortality verification, missing participant verification, and other services specific to the life insurance market services to customers on a contract basis.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALOT', 'STOCK', 'AstroNova, Inc.', 'NGM', 'Technology', 'Computer Hardware', 'AstroNova, Inc. designs, manufactures, distributes, and services a range of products that acquire, store, analyze, and present data in multiple formats. The Company operates through two segments: Product Identification (PI) and Aerospace. The PI segment includes QuickLabel, TrojanLabel, GetLabels, Astro Machine and MTEX and offers digital product marking and identification solutions for brand owners, small print shops and original equipment manufacturers (OEMs), with products sold through channel partners or directly to end users. The T&M segment is designed and manufactured for airborne printing and networking solutions and data acquisition. Its aerospace products include flight deck printing solutions, networking hardware and specialized aerospace-grade thermal paper. Its data acquisition systems are used in research and development, flight testing, missile and rocket telemetry production monitoring, power, and maintenance applications.', 'West Warwick, RI, United States', 441);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COCH', 'STOCK', 'Envoy Medical, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Envoy Medical, Inc. is a hearing health company. The Company is engaged in providing medical technologies across the hearing loss spectrum, all designed to shift the paradigm within the hearing industry and bring both providers and patients the hearing devices they require. Its hearing solutions include hearing aids, middle ear implants, bone conduction devices and cochlear implants. The bone conduction hearing device has two components: an external component and a surgically implanted fixture placed in the bone behind the ear. Its bone conduction hearing device offers amplification without ear mold in the ear. Its hearing aids are devices that amplify sound for those with mild to moderate hearing loss. Its Esteem is a fully implanted active middle ear implant designed to improve the hearing of adults diagnosed with moderate to severe sensorineural hearing loss. Cochlear implants are a solution for people with moderate-to-profound sensorineural hearing loss.', 'White Bear Lake, MN, United States', 42);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMAX', 'STOCK', 'REX Bitcoin Corporate Treasury Convertible Bond ETF', 'NGM', NULL, NULL, 'The fund, under normal market conditions, will invest at least 80% of its net assets (plus any borrowings for investment purposes) in convertible bonds issued by companies that own bitcoin or bitcoin-linked financial instruments in their corporate treasury (“Bitcoin Corporate Treasury Companies”). The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASYS', 'STOCK', 'Amtech Systems, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'Amtech Systems, Inc. is a global manufacturer of thermal processing, wafer cleaning and chemical mechanical polishing (CMP) capital equipment and related consumables used in semiconductor, advanced mobility and renewable energy manufacturing applications. The Companys segment includes Thermal Processing Solutions and Semiconductor Fabrication Solutions. The Thermal Processing Solutions include reflow equipment for chip packaging and electronic assembly, diffusion furnaces and furnaces used to produce ceramic-based power semiconductor packages and passive electronic components. The Semiconductor Fabrication Solutions include consumables, equipment and services for wafer polishing, cleaning, slicing and dicing. It sells process equipment and services used in the fabrication of semiconductor devices, such as silicon carbide (SiC), silicon power, electronic assemblies and modules to semiconductor device and module manufacturers globally, particularly in Asia, North America and Europe.', 'Tempe, AZ, United States', 328);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AFSC', 'STOCK', 'abrdn Focused U.S. Small Cap Active ETF', 'NGM', NULL, NULL, 'Under normal circumstances, the fund invests at least 80% of the value of its net assets, plus any borrowings for investment purposes, in equity securities issued by U.S. small-cap companies. The fund will be managed pursuant to a “focused” strategy whereby the fund’s investment adviser will typically invest the fund’s assets in a small number of issuers. Generally, the Advisor expects to hold approximately 35 to 45 issuers.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('SKRE', 'STOCK', 'Tuttle Capital Daily 2X Inverse Regional Banks ETF', 'NGM', NULL, NULL, 'The fund, under normal circumstances, invests in swap agreements that provide 200% inverse (opposite) daily exposure to TSLA equal to at least 80% of the fund’s net assets (plus any borrowings for investment purposes ). The fund advisor seeks daily leveraged inverse investment results and the fund is very different from most other exchange-traded funds and presents different and greater risks. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DMAT', 'STOCK', 'Global X Disruptive Materials ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets in the securities of the index and in ADRs and GDRs based on the securities in the index. The index is designed to provide exposure to companies that produce metals and other raw or composite materials that have been identified as being essential to disruptive technologies such as lithium batteries, solar panels, wind turbines, fuel cells, robotics, and 3D printers. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FEBO', 'STOCK', 'Fenbo Holdings Limited', 'NCM', 'Technology', 'Consumer Electronics', 'Fenbo Holdings Ltd is a holding company. The Company is mainly engaged in the production and sale of personal care electric appliances, such as electrical hair styling products such as straighteners, curlers, trimmers, and others. The Company also produces toys to overseas markets.', 'Kwun Tong, , Hong Kong', 280);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EMEQ', 'STOCK', 'Macquarie Focused Emerging Markets Equity ETF', 'NGM', NULL, NULL, 'Under normal circumstances, the fund will invest at least 80% of its net assets, plus the amount of any borrowings for investment purposes, in equity securities of emerging markets issuers. The fund invests primarily in a broad range of equity securities of companies located in emerging market countries and may invest in companies of any size. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CET', 'STOCK', 'Central Securities Corporation', 'ASE', 'Financial Services', 'Asset Management', 'Central Securities Corp. is a publicly owned investment manager. The firm invests in the public equity markets of the United States. It also invests on bonds, convertible bonds, preferred stocks, convertible preferred stocks, warrants, options real estate, or short-term obligations of governments, banks and corporations. Central Securities Corp. was founded on October 1, 1929 and is based in New York City.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHV', 'STOCK', 'BlackRock Virginia Municipal Bond Trust', 'NYQ', 'Financial Services', 'Asset Management', 'Blackrock Virginia Municipal Bond Trust is a closed-ended fixed income mutual fund launched by BlackRock, Inc. It is managed by BlackRock Advisors, LLC. The fund invests in fixed income markets of United States. It primarily invests in the investment grade municipal bonds exempt from federal income taxes and Virginia personal income taxes. Blackrock Virginia Municipal Bond Trust was formed on April 25, 2002 and is domiciled in United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EMP', 'STOCK', 'Entergy Mississippi, Inc. 1M BD 66', 'NYQ', NULL, NULL, 'Entergy Mississippi LLC is a United States-based company, which is primarily engaged in the business activity of providing electricity services. The Company transmits and distributes electricity, as well offers online payment, energy restoring, and security lighting services.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EP', 'STOCK', 'Empire Petroleum Corporation', 'ASE', 'Energy', 'Oil & Gas E&P', 'Empire Petroleum Corporation is an oil and gas company with producing assets in New Mexico, North Dakota, Montana, Texas, and Louisiana. The Company operates through its subsidiaries, including Empire New Mexico LLC, doing business as Green Tree New Mexico, Empire North Dakota LLC, Empire Texas LLC, and Empire Louisiana LLC. It is an independent operator in four geographic areas of the United States. Empire New Mexico''s assets primarily produce oil, with natural gas and natural gas liquids (NGLs) accompanying oil production. Empire New Mexico assets are located in Lea County, New Mexico, and consist of a contiguous and consolidated acreage position consisting of 48,000 gross acres and include approximately 714 gross producing and injection wells. Empire North Dakota operates approximately 232 gross injection wells in North Dakota and western Montana. Empire Texas owns over 119 gross wells and approximately 43,000 gross acres as well as 77 miles of gathering lines and pipelines.', 'Tulsa, OK, United States', 63);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATLCZ', 'STOCK', 'Atlanticus Holdings Corporation 9.25% Senior Notes due 2029', 'NGM', NULL, NULL, 'Atlanticus Holdings Corporation is a financial technology company. The Company is focused on facilitating consumer credit through the use of financial technology and related services. The Credit as a Service (CaaS) segment includes its private-label credit and general-purpose credit cards, which, through its bank partners, provide financing solutions to consumers. The Auto Finance segment purchases and/or services loans secured by automobiles and provides other financing options to independent automotive dealers and automotive finance companies. Its private-label and general-purpose card products are originated by The Bank of Missouri and WebBank. Its bank partners originate these accounts through multiple channels, including retail and healthcare point-of-sale locations, direct mail solicitation, digital marketing and partnerships with third parties. The Company uses its technology and proprietary predictive analytics, lenders can make instant credit decisions.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VSDA', 'STOCK', 'VictoryShares Dividend Accelerator ETF', 'NGM', NULL, NULL, 'The fund seeks to achieve its investment objective by investing, under normal market conditions, at least 80% of its assets in securities included in the Nasdaq Victory Dividend Accelerator Index (the "index"). The index utilizes a rules-based approach designed to identify dividend paying stocks with a higher likelihood of future dividend growth.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAPG', 'STOCK', 'Ascentage Pharma Group Internat', 'NGM', 'Healthcare', 'Biotechnology', 'Ascentage Pharma Group International is a holding company primarily engaged in discovering, developing and commercializing therapies primarily in hematological malignancies. The Companys main business is engaged in the development and sales of novel small-scale therapies for cancers, hepatitis B virus and certain age-related diseases. The Companys main products include Olverembatinib (HQP1351), Lisaftoclax (APG-2575), Alrizomadlin (APG-115), Pelcitoclax (APG-1252), APG-5918 and other products. The Companys products are mainly used to address the major hematological malignancies, including chronic myeloid leukemia, acute myeloid leukemia, chronic lymphocytic leukemia, acute lymphocytic leukemia, myelodysplastic syndrome, and multiple myeloma. The Company mainly conducts its business in the domestic market.', 'Suzhou, , China', 567);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHMG', 'STOCK', 'Chemung Financial Corporation', 'NMS', 'Financial Services', 'Banks - Regional', 'Chemung Financial Corporation is a financial holding company. The Company through the Chemung Canal Trust Company (Bank) and CFS Group, Inc (CFS), provides a range of financial services, including demand, savings and time deposits, commercial, residential, and consumer loans, interest rate swaps, letters of credit, wealth management services, employee benefit plans, insurance products, mutual funds, and brokerage services. The Company primarily focuses on banking and wealth management services. Its core banking segment attracts deposits from the public and uses such funds to originate consumer, commercial, commercial real estate, and other loans. Wealth management services provided by the Bank include services as executor and trustee under wills and agreements, and guardian, custodian, trustee, and agent for pension, profit-sharing and other employee benefit trusts, as well as various investment, pension, estate planning, and employee benefit administrative services.', 'Elmira, NY, United States', 343);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BITS', 'STOCK', 'Global X Blockchain & Bitcoin Strategy ETF', 'NGM', NULL, NULL, 'The fund is an actively managed ETF that seeks to achieve its investment objective by investing directly or indirectly in equity securities of U.S. and non-U.S. “Blockchain Companies” and in long positions in U.S. listed bitcoin futures contracts. Under normal circumstances, the fund will invest at least 80% of its net assets, plus the amount of any borrowings for investment purposes, in Blockchain Companies and in long positions on U.S. listed Bitcoin Futures contracts. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DWSH', 'STOCK', 'AdvisorShares Dorsey Wright Short ETF', 'NGM', NULL, NULL, 'The fund is an actively managed ETF that seeks to achieve the fund''s investment objective by obtaining short exposure to investment returns of the broad U.S. large-capitalization equity market through short sales of U.S.-traded equity securities and ETFs. Under normal circumstances, it invests at least 80% of its net assets in investments that create or result in short exposure to U.S. equity securities.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENLT', 'STOCK', 'Enlight Renewable Energy Ltd', 'NMS', 'Utilities', 'Utilities - Renewable', 'Enlight Renewable Energy Ltd is an Israel-based company. Enlight Renewable Energy Ltd operates in the fields of wind energy and solar energy in Israel and in the international market. The Company has four geographical areas of activity such as, Renewable energy activity in Israel within this field, the company engages in the initiation, planning, development, financing, establishment and operation of photovoltaic projects that produce electricity from solar energy in Israel, Central-Eastern Europe that includes wind projects across Central Eastern Europe but also Balkan region , Western Europe where the Company works to develop and establish large wind projects in developed electricity markets in Western European countries, which are mostly based on the sale of electricity in Spain, Sweden and Ireland.', 'Rosh Ha’ayin, , Israel', 360);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACCS', 'STOCK', 'ACCESS Newswire Inc.', 'ASE', 'Communication Services', 'Advertising Agencies', 'ACCESS Newswire Inc. is a communications company, which is engaged in providing public relations (PR) and investor relations (IR) solutions. The Company focuses on customer service and value-driven offerings that enable the brands to connect with their audiences. The Company''s products include PR, IR, All ACCESS, and Conference and Event Software. Its PR products include Access PR Platform, Press Release Distribution, Media Database, Media Pitching and Media Monitoring. The Company''s IR products include Access IR Platform, IR Website, Earnings Calls, Earnings Press Releases and Investor Days. Its professional services include service plans and platform add-ons. The Company''s service plans include Content PRO, Media PRO and Total PRO. Its platform add-ons include premium onboarding, platform management and PR content writing. Its solutions are offered to public companies, private companies, agencies, legal, and resellers, publishers and market research firms.', 'Raleigh, NC, United States', 113);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FATBB', 'STOCK', 'FAT Brands Inc.', 'NCM', 'Consumer Cyclical', 'Restaurants', 'FAT Brands Inc. is a global franchising company, which acquires, markets, and develops fast casual, quick-service, casual dining, and polished casual dining concepts around the world. It owns 18 restaurant brands: Round Table Pizza, Fatburger, Marble Slab Creamery, Johnny Rockets, Fazolis, Twin Peaks, Great American Cookies, Smokey Bones, Hot Dog on a Stick, Buffalos Cafe & Express, Hurricane Grill & Wings, Pretzelmaker, Elevation Burger, Native Grill & Wings, Yalla Mediterranean and Ponderosa and Bonanza Steakhouses, and franchises and owns over 2,300 units worldwide. Round Table Pizza is the franchisor of quick service restaurants located in California and the western United States. Hot Dog on a Stick is the franchisor of quick service restaurants located in regional malls in California and the western United States. Johnny Rockets is an international restaurant franchise and offers menu items including Certified Angus Beef cooked-to-order hamburgers, chicken sandwiches, and malts.', 'Beverly Hills, CA, United States', 2089);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGV', 'STOCK', 'Conductor Global Equity Value ETF', 'NYQ', NULL, NULL, 'The fund is an actively-managed exchange-traded fund (“ETF”) that normally invests at least 80% of its assets in equity securities or investments that are economically tied to equity securities. The fund seeks to achieve its investment objective by investing under normal circumstances in a portfolio of equity securities of companies that are believed to exhibit strong fundamental attributes.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARKR', 'STOCK', 'Ark Restaurants Corp.', 'NGM', 'Consumer Cyclical', 'Restaurants', 'Ark Restaurants Corp. owns and operates approximately 17 restaurants and bars, 16 fast food concepts and catering operations. It operates four restaurant and bar facilities are located in New York City, one is located in Washington, D.C., five are located in Las Vegas, Nevada, one is located in Atlantic City, New Jersey, four are located on the east coast of Florida and two are located on the Gulf Coast of Alabama. The Las Vegas operations include four restaurants within the New York-New York Hotel and Casino Resort and one restaurant within the Planet Hollywood Resort and Casino. In Atlantic City, New Jersey, the Company operates a restaurant in the Tropicana Hotel and Casino. The Florida operations include The Rustic Inn in Dania Beach, Shuckers in Jensen Beach, JB''s on the Beach in Deerfield Beach, The Blue Moon Fish Company in Fort Lauderdale and the operation of four fast food facilities in Tampa and six fast food facilities in Hollywood, each at a Hard Rock Hotel and Casino.', 'New York, NY, United States', 1246);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALTY', 'STOCK', 'Global X Alternative Income ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets in the securities of the underlying index and in American Depositary Receipts ("ADRs") and Global Depositary Receipts ("GDRs") based on the securities in the underlying index. The underlying index is intended to provide exposure to five income-producing categories: Master Limited Partnerships ("MLPs") and Infrastructure, Real Estate, Preferreds, Emerging Market Bonds and Covered Calls.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CKX', 'STOCK', 'CKX Lands, Inc.', 'ASE', 'Energy', 'Oil & Gas E&P', 'CKX Lands, Inc. is engaged in the business of ownership and management of land. Its activities consist of leasing its properties for minerals (oil and gas), raising and harvesting timber and surface use (agriculture, right of ways, hunting). Its segments include oil and gas, surface and timber. It leases property to oil and gas operators and collects income through its land ownership in the form of oil and gas royalties and lease rentals and geophysical revenues. It receives income from royalty interests and mineral leases related to oil and gas production, timber sales, land sales and surface rents. Oil and Gas segment provides the customer access to a designated tract of land upon which the customer performs exploration, extraction, production and ultimate sale of the oil and gas. It receives royalties on all oil and gas produced by the customer. Timber income is derived from the sales of timber on its lands. Surface income is earned from various recurring and non-recurring sources.', 'Lake Charles, LA, United States', 2);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AUBN', 'STOCK', 'Auburn National Bancorporation, Inc.', 'NGM', 'Financial Services', 'Banks - Regional', 'Auburn National Bancorporation, Inc. is a bank holding company. The Companys business is conducted primarily through AuburnBank (the Bank) and its subsidiaries. The Bank offers checking, savings, transaction deposit accounts and certificates of deposit, and is an active residential mortgage lender in its primary service area. The Banks primary service area includes the cities of Auburn and Opelika, Alabama, and nearby surrounding areas in East Alabama, primarily in Lee County. The Bank also offers commercial, financial, agricultural, real estate construction and consumer loan products and other financial services. The Bank also provides automated teller machine (ATM) services in East Alabama and operates ATMs in approximately 10 locations in its primary service area. The Banks Visa Check cards can be used internationally through the Plus network. The Bank offers online banking, bill payment and other electronic banking services through its Internet Website.', 'Auburn, AL, United States', 145);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGNCM', 'STOCK', 'AGNC Investment Corp.', 'NMS', 'Real Estate', 'REIT - Mortgage', 'AGNC Investment Corp. is an internally managed real estate investment trust (REIT). The Company provides private capital to the United States housing market, enhancing liquidity in the residential real estate mortgage markets and, in turn, facilitating home ownership in the United States. The Company invests primarily in Agency residential mortgage-backed securities (Agency RMBS) on a leveraged basis. These investments consist of residential mortgage pass-through securities and collateralized mortgage obligations for which the principal and interest payments are guaranteed by a United States Government-sponsored enterprise, such as the Federal National Mortgage Association (Fannie Mae) and the Federal Home Loan Mortgage Corporation (Freddie Mac, and together with Fannie Mae, the GSEs), or by a United States Government agency, such as the Government National Mortgage Association (Ginnie Mae). It may also invest in other assets related to the housing, mortgage or real estate markets.', 'Bethesda, MD, United States', 53);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DDT', 'STOCK', 'Dillards Capital Trust I CAP SECS 7.5%', 'NYQ', NULL, NULL, NULL, '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMBI', 'STOCK', 'Ambipar Emergency Response', 'ASE', 'Industrials', 'Waste Management', 'Ambipar Emergency Response is a Brazil-based holding company. The Company is primarily engaged in the environmental and emergency response services industry. The Company focuses on managing environmental risks and responding to emergencies involving hazardous materials, industrial accidents, and natural disasters. Their key product is Emergency Response Services, which is a comprehensive service offering that includes containment, mitigation, and remediation of environmental incidents. It aims to reduce environmental damage, protect human health, and ensure compliance with environmental regulations. The Company integrates technologies such as Geographic Information Systems (GIS) and Artificial Intelligence (AI) to support real-time monitoring, decision-making, and operational efficiency during emergency situations. These services are provided to clients across sectors including logistics, energy, chemicals, and manufacturing.', 'São Paulo, SP, Brazil', 7435);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CULP', 'STOCK', 'Culp, Inc.', 'NYQ', 'Consumer Cyclical', 'Textile Manufacturing', 'Culp, Inc. is a marketer of mattress fabric for bedding and upholstery fabrics for residential, commercial, and hospitality furniture in North America. The Company markets a variety of fabrics to its global customer base of bedding and furniture companies, including fabrics produced at the Companys manufacturing facilities and fabrics sourced through other supplies. Its segments include mattress fabrics and upholstery fabrics. The mattress fabrics segment, also known as Culp Home Fashions, manufactures and markets mattress fabrics and sewn mattress covers for bedding manufacturers. These products include woven jacquard fabrics, knitted fabrics, and some converted fabrics. The upholstery fabrics segment markets fabrics for residential, commercial, and hospitality furniture. This segment also includes window treatment products and installation services through its Read Window Products business, including roller shades, drapery, hardware, and top-of-mattress soft goods.', 'High Point, NC, United States', 829);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CFA', 'STOCK', 'VictoryShares US 500 Volatility Wtd ETF', 'NGM', NULL, NULL, 'The fund seeks to achieve its investment objective by investing, under normal market conditions, at least 80% of its assets directly or indirectly in the securities included in the Nasdaq Victory U.S. Large Cap 500 Volatility Weighted Index, an unmanaged, volatility weighted index maintained exclusively by the index provider. The index identifies the 500 largest U.S. stocks by market capitalization measured at the time the index''s constituent securities are determined.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AFGD', 'STOCK', 'American Financial Group, Inc.', 'NYQ', NULL, NULL, 'American Financial Group, Inc. is an insurance holding company. Through the operations of Great American Insurance Group, the Company is engaged primarily in property and casualty insurance, focusing on specialized commercial products for businesses. The Companys segments include property and casualty insurance and Other. The property and casualty insurance business includes specialty sub-segments: property and transportation, which includes physical damage and liability coverage for buses and trucks and other specialty transportation niches, inland and ocean marine, agricultural-related products and other commercial property coverage; specialty casualty, which includes primarily excess and surplus, executive and professional liability, general liability, umbrella and excess liability, and specialty financial, which includes risk management insurance programs for lending and leasing institutions, fidelity and surety products and trade credit insurance.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('TMB', 'STOCK', 'Thornburg Multi Sector Bond ETF', 'NGM', NULL, NULL, 'The fund pursues its investment objective by investing in a broad range of income-producing investments, primarily including debt obligations. The fund manager may invest in debt obligations of any kind, of any quality, and of any maturity. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENO', 'STOCK', 'Entergy Utility Group, Inc. 1ST MTG BD 66', 'NYQ', NULL, NULL, 'Entergy New Orleans, LLC is an electric and gas utility company. The Company is engaged in the generation, transmission, distribution, and sale of electric power. The Company owns an 870 megawatt (mg) Michoud Plant generating station. Its Michoud Plant located in eastern New Orleans. The Company is also engaged in operating a natural gas distribution business.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANL', 'STOCK', 'Adlai Nortye Ltd.', 'NGM', 'Healthcare', 'Biotechnology', 'Adlai Nortye Ltd. is a Cayman Islands-based investment holding company. The Company is involved in the research and development of pharmaceutical products. It is a clinical-stage company focused on the development of targeted and immune-modulating cancer therapies. It is advancing an oncology pipeline, with Buparlisib (AN2025), a pan-phosphoinositide 3-kinase (PI3K) inhibitor, being evaluated in a registrational Phase three trial (NCT04338399) for patients with recurrent or metastatic head and neck squamous cell cancer (HNSCC) that has progressed after prior anti-programmed death-ligand 1 (PD-L1) treatment. It is also advancing multiple drug candidates, including AN4005, an oral small molecule PD-L1 inhibitor; AN8025, a multifunctional fusion protein acting as a T cell and antigen-presenting cell (APC) modulator; and AN9025, an oral small molecule pan-rat sarcoma virus (RAS) inhibitor. The Companys subsidiary, Alpine Bioscience Ltd. (Alpine BVI), is an investment holding company.', 'Grand Cayman, , Cayman Islands', 123);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASBA', 'STOCK', 'ASBA', 'NYQ', NULL, NULL, 'Associated Banc-Corp is a bank holding company. The Company, through Associated Bank and various nonbanking subsidiaries, provides an array of banking and nonbanking products and services to individuals and businesses through 188 banking branches, serving more than 100 communities, primarily within its three-state branch footprint. The Corporate and Commercial Specialty segment serves a wide range of customers, including larger businesses, developers, not-for-profits, municipalities, and financial institutions by providing lending and deposit solutions as well as the support to deliver, fund, and manage such banking solutions. The Community, Consumer and Business segment serves individuals and businesses by providing lending and deposit solutions and a variety of investment, fiduciary, and retirement planning products and services. The Risk Management and Shared Services segment includes key shared operational functions and also includes residual revenue and expenses.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APED', 'STOCK', 'STKd 100% MSTR & 100% COIN ETF', 'NGM', NULL, NULL, 'The fund is an actively-managed ETF that seeks to achieve its investment objective by employing derivatives, namely swap agreements and/or listed options contracts, to gain long exposure to two underlying securities, MicroStrategy Incorporated d/b/a Strategy (“MSTR”) and Coinbase Global, Inc. (“COIN”) (MSTR and COIN, each an “Underlying Security,” and together the “Underlying Securities”). The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('LGRO', 'STOCK', 'Level Four Large Cap Growth Active ETF', 'NGM', NULL, NULL, 'The fund invests primarily in equity securities of carefully selected, high-quality U.S. companies. The fund invests primarily in the domestic equity securities of companies selected by Level Four Capital Management, LLC for their growth potential within various market sectors.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACU', 'STOCK', 'Acme United Corporation', 'ASE', 'Consumer Defensive', 'Household & Personal Products', 'Acme United Corporation is a supplier of first aid and medical products and cutting technology to the school, home, office, hardware, sporting goods and industrial markets. The Company markets and sells under two main product categories: first aid and medical; and cutting and sharpening. The first aid and medical category offers first aid and safety products under brands such as, First Aid Only, PhysiciansCare, Pac-Kit, Spill Magic, First Aid Central, Med-Nap, Safety Made and Elite brands. The cutting and sharpening categories offer school, home and office products, under the Westcott brand, and hardware, industrial and sporting goods products under the Clauss and DMT brands. It operates in the United States (including Asian operations), Canada and Europe. The Company sells its products primarily to mass market and e-commerce retailers, industrial distributors, wholesale, contract and retail stationery distributors, office supply superstores, sporting goods stores, and hardware chains.', 'Shelton, CT, United States', 633);\n